import { Container, Dropdown, DropdownItem, DropdownMenu, DropdownToggle } from "reactstrap";
import './CompanyList.css';
import logo from './../../images/logo.png';
import { useEffect, useState } from "react";

function CompanyList(){
    const [filter, setFilter] = useState(false);
    const toggle = () => setFilter(prevState => ! prevState);
    const [searchTerm, setSearchTerm] = useState('');
    const [searchResult, setSearchResult] = useState([]);

    const data = [];
    const handleChange = event =>{
        setSearchTerm(event.target.value);
    }

    useEffect(() => {
        const results = data.filter(newdata => newdata.toLowerCase().include(searchTerm));
        setSearchResult(results);
    }, [searchTerm]);
    return(
        <Container>
            <div>
                <img src={logo} alt=""/>
            </div>
            <div className="banner">
                Company List
            </div>
            <div className="search_form">
                <input type="search" className="form-control rounded" placeholder="Search by name company" aria-label="Search"
                    aria-describedby="search-addon"/>
                <Dropdown isOpen={filter}toggle={toggle}>
                    <DropdownToggle caret>
                        Filter
                    </DropdownToggle>
                    <DropdownMenu>
                        <DropdownItem>Active</DropdownItem>
                        <DropdownItem>Deactive</DropdownItem>
                    </DropdownMenu>
                </Dropdown>
            </div>

        </Container>
    );
}
export default CompanyList;
